import React from 'react';
import Card from '../card';

function Cards ({data}){
    console.log(data);
    return(
        <>
        {

            data.map((element) => {
                return <Card user = {element} key = {element.id}> </Card>
            })

        }
        </>
    )
}

export default Cards;
